[{"location":"#DynamicObjects.jl","page":"DynamicObjects.jl","title":"DynamicObjects.jl","text":"","category":"section"},{"location":"","page":"DynamicObjects.jl","title":"DynamicObjects.jl","text":"Documentation for DynamicObjects.jl.","category":"page"},{"location":"","page":"DynamicObjects.jl","title":"DynamicObjects.jl","text":"DynamicObject{T}","category":"page"},{"location":"#DynamicObjects.DynamicObject","page":"DynamicObjects.jl","title":"DynamicObjects.DynamicObject","text":"DynamicObject{T}\n\nA DynamicObject is a thin named wrapper around a generic NamedTuple which enables function overloading. The type is inefficient computationally, but can enable more efficient prototyping/development.\n\n\n\n\n\n","category":"type"},{"location":"","page":"DynamicObjects.jl","title":"DynamicObjects.jl","text":"@dynamic_object","category":"page"},{"location":"#DynamicObjects.@dynamic_object","page":"DynamicObjects.jl","title":"DynamicObjects.@dynamic_object","text":"@dynamic_object(name, args...)\n\nDefines a DynamicObject:\n\n@dynamic_object Rectangle height width\n\ndefines a dynamic type called Rectangle = DynamicObject{:Rectangle} with defining attributes height and width and defines a constructor\n\nRectangle(height, width; kwargs...) = DynamicObject{:Rectangle}((height=height, width=with, kwargs...))\n\nThis dynamic type can be used in function definitions as \n\narea(what::Rectangle) = what.height * what.width\n\n\n\n\n\n","category":"macro"}]
